"title": "Freshly Picked Quality Vintage from New York, with love",
"announcement": "Beautiful, quality vintage items hand-picked from Montauk to Manhattan and beyond.  Gifts and collectibles, costume jewelry, lingerie and truly unique finds from New York&#39;s regal estate sales, quaint second hand shops and everything in between.  I have a second shop just for vintage lingerie.  International shoppers welcome!",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Please visit my other shops at https://www.etsy.com/shop/EveryDayLingerie for hand-picked quality &quot;everyday&quot; lingerie items -- free domestic shipping there on all lingerie orders every day, no coupon code needed!  \r\n\r\nAnd my newest endeavor, The Rejeweler, https://www.etsy.com/shop/TheRejeweler for the finest quality handmade and upcycled vintage and contemporary finds including handmade jewelry using vintage beads and findings, tin fridge magnets using vintage can labels and more.  \r\n\r\nThank you for supporting this small business!  Enjoy your purchase.",
"digital_sale_message": null,
