"title": "Frederic Loraschi Gourmet Chocolates",
"announcement": "Dear chocolate lover,\r\n\r\nWelcome to my Etsy store where you will find truly unique handmade gourmet chocolate gifts and confections that will delight your senses!\r\n\r\nMy name is Frederic Loraschi and I am a master chocolatier located in Harrisburg Pennsylvania.\r\n\r\nI am constantly challenging conventions and questioning what we do every day so that our chocolates and confections are simply an exquisite culinary experience.  I had the chance to learn my craft alongside very passionate chefs around the world. After many years in the field, my need to challenge conventions and constantly question what I do lead me to create Frederic Loraschi Chocolate.\r\n\r\nI enjoy arriving in my shop early in the morning to the fragrance of warm melted chocolate, discovering rare and precious single origin chocolates that are delicate, harmonious and more intense and therefore more alive!\r\n\r\nI love the perfume of caramelized hazelnuts, almonds and peanuts that meticulously processed in our workshop will become our signature pralines.\r\n\r\nSourcing only the finest ingredients leads to the creation of our chocolate collections that will arouse your senses with more flavors and more finesse!\r\n\r\nOur commitment to excellence had Frederic Loraschi Chocolate win the “Best Tasting” award at the U.S. Selection for the World Chocolate Masters in 2010 and “Top 10 Best Chocolatiers” in North America by Dessert Professional magazine in 2011.\r\n\r\nAs an artisan, I am profoundly lucky to be able to share my passion for chocolate with you, my customers.\r\n\r\nAffectionately,\r\nFrederic Loraschi\r\n",
