"policy_payment": null,
"policy_shipping": "It is our goal to get your orders to you as quickly and efficiently as we can. The standard shipping services that Frederic Loraschi Chocolate uses on all orders are provided by UPS.\r\n\r\nOrders take 1-2 days to process.  \r\n\r\nCOLD WEATHER MONTHS:\r\n(Mid September until mid June)\r\n\r\nDuring the coolest part of the year we supply you with the following options:\r\n\r\nUPS Ground (your package is delivered around 1-5 business day depending on the location selected)*\r\nUPS Next Day Air Saver (your package is delivered on the next business day in the entire country)*\r\nUPS Second Day (your package is delivered on the second business day in the entire country)*\r\n \r\n*Keep in mind that UPS do not work over the weekends and any major holidays, therefore delivery date may be altered if your package spends the weekend in transit. To avoid any extra transit time, we recommend that you order at the beginning of the week.\r\n\r\nUpon review of your order, a customer service representative will decide to use our hot weather packaging based on your recipient&#39;s local weather and temperature. There is no action required on your part and this service is complimentary.\r\n\r\n All orders are shipped “no signature required” which means the package will be left at the shipping address.\r\n\r\nFrederic Loraschi chocolate is not responsible if your package is lost or stolen after UPS has completed the delivery.\r\n\r\n\r\nHOT WEATHER MONTHS:\r\n(Mid June until mid September)\r\n\r\nDuring the warmest part of the year we supply you with the following options:\r\n\r\nUPS Ground (your package is delivered the next day for the following states and none others)*\r\n(Pennsylvania, New Jersey, Delaware, Maryland, District of Columbia, Connecticut) \r\nUPS Next Day Air Saver (your package is delivered on the next business day in the entire country)*\r\nUPS Second Day (your package is delivered on the second business day in the entire country)*\r\n \r\n*Keep in mind that UPS do not work over the weekends and any major holidays, therefore delivery date may be altered if your package spends the weekend in transit. To avoid any extra transit time, we recommend that you order at the beginning of the week.\r\n\r\nOur hot weather packaging guarantees that your chocolates arrive in perfect condition anywhere in the country. This packaging uses insulated containers and refrigerant packs to maintain an interior temperature between 15°C and 20°C (59°F and 67°F) until delivery. Upon review of your order, a customer service representative will decide to use our hot weather packaging based on your recipient&#39;s local weather and temperature. There is no action required on your part and this service is complimentary.\r\n\r\nAll orders are shipped “no signature required” which means the package will be left at the shipping address. Please make an effort to notify the recipient that a sweet gift is on its way so the package is not left outside in warm weather for too long.\r\n\r\nFrederic Loraschi chocolate is not responsible if your package is lost or stolen after UPS has completed the delivery.\r\n\r\nShipping Costs:\r\nCost shown on the order is an ESTIMATE. We will recalculate the shipping cost when processing your order and we will refund any extra postage. We will refund you via the method selected for payment on the order. \r\n",
"policy_refunds": "It is our goal at Frederic Loraschi Chocolate for all of our customers, large and small, to be 100% satisfied with their order. If you happen to experience any shipment loss, damage or shortages we ask that you report them to us within 24 hours of receipt. It would be easiest to reach us by email using the  floraschichocolat@verizon.net address, and a member of our staff will respond to you in a prompt manner . Please provide us with your name, email address, phone number, your Frederic Loraschi chocolate order number and a photo of the damaged product.\r\n\r\nFrederic Loraschi Chocolate will not be responsible for spoiled products unless such spoilage occurred during the shipping process in which we would be happy to replace your item for you at no additional cost.\r\n",
