"title": "DJVintageCollectible",
"announcement": "Welcome to DJVintageCollectible I list new items on a regular basis, I do my best to be very specific and accurate with the descriptions of all items in my shop. My shop contains a sale and clearance section, which list items that have been marked down for additional savings. I am happy to provide an exact cost for shipping if you convo me your address. Additionally, I ship outside the United States just convo me with your address for a shipping quote .\r\n\r\nRemember, orders shipped to West Coast are cheaper because that is where I live. Also, I will always combine shipping and try to help you save money on shipping cost and the cost of items; please convo me if you have any questions.\r\n\r\n\r\nPlease enjoy browsing my shop and convo me if you have any questions, I usually reply back quickly.",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you for shopping at DJVintagecollectible your order will ship in one day. Please feel free to continue to shop, I will always combine shipping to help save you money. I would appreciate a review about my service and shop once you receive your items and your order is complete. \r\nThank you for shopping with DJVintageCollectible,\r\n",
"digital_sale_message": null,
"last_updated_tsz": 1411089486,
"listing_active_count": 460,
"login_name": "jcgodsprop",
"accepts_custom_requests": false,
"policy_welcome": "Welcome to DJVintageCollectibles,\r\nI was a partner in the shop dkcollectibles with my next door neighbor. After working together for 10 months we decided I should open my own shop. I enjoy finding great vintage items and I try to list items that are affordable and great quality. ",
"policy_payment": "I gladly accept direct check-out, Paypal, Etsy Gift Cards and money orders.\r\n\r\nIf you are paying with a money order, I like to receive money orders within two weeks of the purchase and ask that you convo me to let me know the money order is on the way, this will help me have your order packed and ready.  \r\n \r\n",
"policy_shipping": "Please remember that included in the cost of postage is the cost of handling, including my seller fees and shipping supplies. I always try to use recycled shipping materials to cut down on shipping cost.\r\n\r\nI try to ship all orders either the same day or a day after an order is placed. I do my best to estimate the correct shipping cost and find the fastest way to get your order to you usually in 1-3 days, however, the heavier items usually ship parcel post and take ( 2-9 days).\r\n\r\nAll items that ship within the USA ship with a tracking number. I insure most items, at my cost. I do my best to pack everything carefully, prevent loss or damage.\r\n\r\nPlease notify me immediately if there is any damage to your item. If there is damage, please keep the boxes and all wrapping materials until the the issue is settled. Items that are insured through the USPS: THE SELLER WILL IMMEDIATELY REFUND THE PURCHASE PRICE OF THE ITEM AND FILE A CLAIM WITH THE USPS. However, I will need pictures of any items that arrives damaged before a refund can be issued ( this is for filing the claim with the USPS) .\r\n \r\nWhen purchasing multiple items I will always automatically combine shipping cost to save you money and refund excess shipping cost. You can always convo me with your zip code or Country of Origin if you want an item to ship faster or if you want the exact shipping cost before making a purchase.\r\n\r\nAll my shipping cost are calculated for East Coast so the shipping is usually less if you live on West Coast where I live.\r\n\r\nNote- Remember, to plan ahead for gift and holiday shopping (the post office tends to take longer during major holidays to deliver packages). \r\n\r\nI always to quickly answer any question you may have, just convo me.",
"policy_refunds": "I pack carefully. Please notify me immediately if there is damage, please keep the boxes and all wrapping materials until the the issue is settled. Items that are insured through the USPS: THE SELLER WILL IMMEDIATELY REFUND THE PURCHASE PRICE OF THE ITEM AND FILE A CLAIM WITH THE USPS. However, I will need pictures of any items that arrives damaged before a refund can be issued ( this is for filing the claim with the USPS) .\r\n\r\nIf an item arrives damaged and is not insured I will issue a refund for the damaged item; I do require pictures of any items that arrives damaged.",
"policy_additional": "I do my best to keep my customers happy. I will reserve items for you until payday, ship to another country, ship it to someone else as a gift, add a note or allow you to pick up items to save on shipping.  My goal is to help you save money and have a great shopping experience at DJVinatgecollectible.\r\n\r\nMy shop list the shipping for the United States, but I am happy to ship internationally, just convo me with your address for a shipping quote.",
