"title": "Vintage Southwest",
"announcement": "SUMMER IS WINDING DOWN SO TIME TO TALK FALL WEDDINGS AND GIFTING IDEAS.....I OFFER NUMEROUS FENTON GLASS ITEMS / ENTERTAINING ITEMS MANY THAT LEAN TOWARDS ELEGANT HOLLYWOOD REGENCY STYLE.......I ALSO OFFER OTHER QUALITY GLASS AND POTTERY ITEMS.......\r\n\r\nOffering  American vintage pottery, vintage art glass and porcelains,  Fenton art glass, vintage jewelry and various collectible items.  I also love vintage Native American art works whether pottery or basketry.  The Native American items I list are authentic and I stand by the authenticity.  Majority of the items in my shop are from auctions and estates in the Scottsdale and Phoenix metro areas.  I also acquire items from the Midwest US.  \r\n",
