"policy_welcome": "For immediate assistance give us a call at 646-583-3920\r\n(M-F from 9:30am to 5:00pm EST)",
"policy_payment": "DecanterEngraving currently accepts payment through PayPal only, however you can use your credit card through Paypal even if you don not have a PayPal account by selecting the &quot;Check out as a guest&quot; option&quot; once on the PayPal page. \r\n\r\nENGRAVING FEE**\r\nPricing shown for the listings already includes engraving on 1 location (i.e. the front of the decanters / barware). Engraving on a secondary location (i.e. on the back) will carry an extra charge. Please note that engraving on the back may be visible &quot;backwards&quot; when viewed from the front. ",
"policy_shipping": "ORDER PROCESSING**\r\nMost orders ship within 1 to 3 business days from our New York City location. Contact us to confirm productions times for quantity orders over 10 items.\r\n\r\nSTANDARD SHIPPING**\r\nStandard shipping is provided via FedEx Ground service. See estimated shipping times below:\r\nhttps://www.etsy.com/listing/167121040/fedex-ground-shipping-times\r\nNOTE: Shipping rates indicated above are for destinations within the 48 contiguous US states. Shipping to certain parts of  HI and AK may require additional shipping fees.\r\n\r\n\r\nEXPRESS SHIPPING**\r\nUSPS Priority 2-Day option is available for most our listings during checkout. Contact us for custom quote if faster / expedited shipping is needed. \r\n\r\nINTERNATIONAL SHIPPING**\r\nInternational shipping is available to most countries via USPS International Priority service (4 to 8 business days). Contact us for a custom shipping quote for a particular item.\r\n\r\nShipping to multiple addresses (multiple recipients) is available for domestic destinations for a handling fee of $3 for each additional address.\r\n\r\nDAMAGED SHIPMENTS**\r\nAs per our damaged shipment policy, we ask that you report any shipping related damages within 7 days of receipt  in writing by emailing us at info@engravesolutions.com and attach an image of the damaged item(s). If a replacement item is warranted, we will engrave and ship it out to you as soon as possible (using the original shipping method) at no cost to you.",
"policy_refunds": "We go to great lengths to ensure that our engraved products come out looking the best they can. However, certain circumstances are beyond our control. Please note that we cannot be responsible for:\r\n\r\n• Spelling, punctuation or grammatical errors made by the customer.\r\n• Errors in user-selected options such as product type or size.\r\n• Please note that most crystal products in our selection are hand crafted items. While we carefully inspect each item for any potential flaws before engraving, we cannot be responsible for minor imperfections inherent in hand crafted crystal products.\r\n\r\nIf you are not completely satisfied with your purchase and believe it is attributable to an error during our engraving process (apart from the instances listed above) please contact us within 7 days of receiving the item(s). We will try our best to resolve any issues that may come up.",
"policy_additional": "PROOF APPROVAL**\r\nFor engraved items, a digital proof will be prepared and emailed for review/approval before production begins. Please note that proof approval is required to begin production on order with custom engraving. However, if no response is received/feedback is received within 7 business days, the order will be processed and shipped with discretionary approval from our in-house production team. ",
