"announcement": "SHOP ANNOUNCEMENTS:\r\n\r\nThank you for visiting our shop!\r\n\r\nCURRENT ESTIMATED PRODUCTION TIME:\r\n\r\n1 - 3 business days to receive proof confirmation\r\n2 - 3 business days production time\r\n2 - 5 business days to ship (estimated time)\r\n6 - 10 business days to ship (international; estimated time)\r\n(Updated: 7/03/14)\r\n\r\n* Expedited services available-- please contact us to inquire.\r\n\r\nIt&#39;s Wedding Season!!\r\n\r\nDuring this time we are experiencing a high volume of orders. We will do our best to efficiently process your order as quickly as possible. Due to this high season, our production time has been extended.\r\n\r\nPlease consider that messages/emails can also take 24 - 48 hours to receive a response. If your inquiry requires immediate attention, please call us at the number listed in our &quot;shop policies&quot; page. We will assist you in any way possible.\r\n\r\n*Production time subject to change depending on how soon proof is approved/if we need to make changes/adjustments/additions.\r\n\r\nOrders will be processed in the exact order as they are received and completed as quickly as possible. Consider that we are producing several dozen orders at ONE time. We appreciate your patience and understanding.\r\n\r\nPlease use the &quot;Request a Custom Item&quot; option only if your request is not already offered in our shop. If the item/design already exists, just add the item(s) to your cart and follow the instructions shown in the listing.\r\n\r\nAll items are made to order.\r\n\r\nFor custom designs and additional inquiries please message us.\r\n\r\nBe sure to follow us on Facebook, Instagram, Twitter, and Pinterest for the newest arrivals, inspiration, and special promotions!\r\n\r\nFacebook: www.facebook.com/letstietheknot\r\nInstagram: @letstietheknot\r\nTwitter: @_letstietheknot\r\nPinterest: www.pinterest.com/letstietheknot/",
