"vacation_message": null,
"sale_message": "Thank you so much for your order!\r\n\r\nA proof of your requested design will be sent to your [Etsy email] within 1-3 business days to confirm that all elements are exactly as requested. We will [not] begin production until proof is approved.\r\n\r\nPlease visit our shop&#39;s homepage for our current estimated production time line.\r\n\r\nOrders will be processed in the exact order as they are received and completed as quickly as possible. Please consider that we are producing several dozen orders at ONE time. We appreciate your patience and understanding and look forward to completing your order! \r\n\r\nBest,\r\nJenny & Charles",
"digital_sale_message": "Thank you for your order!\r\n\r\nYour files will be available for immediate download following receipt of payment.\r\n\r\nBest,\r\nJenny & Charles",
