"policy_welcome": "Thank you for visiting our shop!\r\n\r\nWe are specialist in custom engraving that create one-of-a-kind mementos to commemorate your special day.\r\n\r\nDESIGN. ENGRAVE. ENJOY!\r\n\r\nIf you have any questions, please contact us through Etsy, by phone, or email and we will get back to you as soon as possible.\r\n\r\nReach us by phone: \r\n(714) 266-0230\r\n\r\nOr by email:\r\n[shopletstietheknot@gmail.com]\r\n\r\nShowroom\r\n(viewing and/or pick up by appointment only)\r\n7314 Melrose St.\r\nBuena Park, CA 90621\r\n\r\nIf you are local, we welcome you to place your order and pick up at our showroom!",
"policy_payment": "We gladly accept payments made securely through Direct Checkout or Paypal/Paypal Credit Card Processor. \r\n\r\nOrder will ship once completed and payment is paid in full.\r\n\r\nNote: If order is paid with an &quot;e-check&quot;-- we will send confirmation of proof approval once payment has cleared. Estimated production time will begin from the date payment clears.",
"policy_shipping": "CURRENT ESTIMATED PRODUCTION TIME: Please refer to our shop&#39;s homepage announcements. Rush/Expedited services available for an additional fee; upon request-- inquire for further details.\r\n\r\nOrders will ship via USPS Priority Mail or UPS Ground Service.\r\n\r\nDomestic: estimated 2-5 business day delivery time once shipped\r\nInternational: estimated 6-10 business day delivery time once shipped)\r\n\r\nFor international shipping please message us with your &quot;ship to address&quot; and we will provide a quote to you.\r\n\r\nPlease note that most of our items are highly fragile and require additional support to ensure safe transportation of your custom products.\r\n\r\nShipping rates include:\r\n- Insurance for total value (coverage for loss or damaged packages)\r\n- Packing materials to ensure safe transportation (double boxing, peanuts, tissue paper, bubble paper, tape, fragile stickers, etc)\r\n- Full tracking number\r\n\r\n** If your package arrives damaged, please contact us immediately so we may file a claim with the corresponding shipping service-- We will get new a item(s) sent out right away for you. Please hold onto the damaged item(s) in case the shipping provider requires a pick up for further inspection. **\r\n\r\nReplacement items will be sent using the same shipping method-- if your order requires expediting, there will be an additional fee.\r\n\r\nPlease confirm the address entered at checkout or on PayPal matches your shipping address as that will be the address we ship to. Additional charges due to insufficient address or return shipments will be billed to the buyer. \r\n\r\nAll orders will be checked & packaged carefully to ensure safe transportation. If there are any discrepancies upon receiving your order, please contact us immediately.",
"policy_refunds": "ALL CUSTOM ORDERS ARE FINAL SALE.\r\n\r\nDue to the custom nature of our items-- Once production is in progress, orders cannot be changed or canceled. Any changes or cancellations will will acquire a cancellation fee. Fee will vary depending on how far along we are in production.\r\n\r\nEngraved/personalized/custom items are non-refundable. If there are any discrepancies with your order please contact us immediately.",
"policy_additional": "If you are happy with your order, positive feedback is greatly appreciated!\r\n\r\nIf you are not completely satisfied with your purchase, please contact us first before leaving feedback. We will be happy to work with you to resolve any issues.",
