"title": "Jack Daniels Whiskey Inspired 50th Birthday Food Tents Template - Editable - DIY Decorations - DIY Party Favors - Instant Download Printable",
"description": "An editable PDF template with food tents that can be used for a Jack Daniels themed party. An easy theme choice for a birthday party, especially a milestone birthday! Just download the file, click the text boxes, and type the names of the food items you&#39;ll be serving! These tents measure 3.5 x 2.5 inches and print four per 8.5 x 11 sheet.\r\n\r\n▧ Please message me if you need a custom age! ▧\r\n\r\nLooking for food tents for a 30th birthday? Click here:\r\nhttps://www.etsy.com/ca/listing/202392839/jack-daniels-whiskey-inspired-30th?\r\n\r\n40th birthday? Click here:\r\nhttps://www.etsy.com/ca/listing/197474370/jack-daniels-whiskey-inspired-40th?\r\n\r\nMatching invitation here:\r\nhttps://www.etsy.com/ca/listing/194716598/jack-daniels-whiskey-inspired-birthday?ref=listing-shop-header-0\r\n\r\nMatching birthday party signs (8.5x11) here:\r\nhttps://www.etsy.com/ca/listing/194875478/jack-daniels-whiskey-inspired-birthday?ref=shop_home_feat_1\r\n\r\n\r\n*You are ordering a digital product ONLY. You will receive a high quality, 300dpi PDF file customized with your event details. You can then print the file as many times and in whichever way you choose! Please note that you will NOT receive a paper product (unfortunately, I don’t offer printing at this time).*\r\n\r\nQuestions about digital purchases? See this link!:\r\nhttps://www.etsy.com/ca/help/article/3949\r\n\r\n\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n▧ HOW DOES IT WORK? ▧\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\n1. Add this item to your Etsy shopping cart.\r\n\r\n2. After purchasing the digital file, you’ll see a link to the Downloads page. Here, you can download all the files associated with your order.\r\n\r\n3. Open the file, click on the text boxes, and type in your information!\r\n\r\n4. Print your food tents! You can use the file to create as many food tents as you need!\r\n\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n▧ HOW DO I PRINT MY FILE? ▧\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\nYou have a few printing options. The great thing about DIY printables is that you can print as many as you want, however you want!\r\n\r\nPrint from Home - Print onto white cardstock (at least 110lbs recommended). Remember if you print on cardstock other than white, the colours of the design may vary. Your PDF will include cut marks to follow when cutting them out.\r\n\r\nCommercial Printer – You can print the file using places like Staples, Walmart, etc. Save your PDF to your computer and either order prints on their website or bring the file into your local copy shop on a USB flash drive. Again, cut marks are included as required by these commercial printers.\r\n\r\nOnline Options – Sites like Vistaprint.com offer printing BUT they do not allow standard sizes like 5x7 or 4x6. Please let me know if you are using Vistaprint ASAP so I can change the sizing of your file.\r\n\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n▧ PLEASE NOTE ▧\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\nPlease note the colour that you see on your monitor may not be the exact same as your printed product. All monitors are different and display colours different. I recommend printing your proof on your home printer first to make sure you are satisfied with the colours.\r\n\r\nItems are strictly for personal (non-commercial) use only. This material cannot be reproduced, forwarded, shared, or otherwise distributed.\r\n\r\nStripes & Chevron wants to ensure that you are 100% satisfied with your purchase and we will do our best to correct any issues. However, due to the nature of our products absolutely no refunds or exchanges will be given.\r\n\r\n▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧\r\n\r\n*´¨)\r\n¸.•´¸.•*´¨) ¸.•*¨)\r\n(¸.•´ (¸.•` ¤ Check out my shop at https://www.etsy.com/ca/shop/StripesAndChevron\r\n\r\n▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧▧",
